    }
  }


  render() {
    return (
      <div>
        <ul className='list'>
          {
            data.map(obj => (
              <li className='list-obj'>
                <span className='username'>
                  {obj.sender}
                </span>
                <p>{obj.message}</p>
              </li>
            ))
          }
        </ul>
      </div>
    )
  }
}

export default Messages
